INSERT INTO `yx_system_config` VALUES ('210', 'store_buy_info', '<p class=\"ql-align-center\"><strong>小象农庄商城购物温馨提示</strong></p><p><br></p><p>．关于快递</p><p><br></p><p>本店默认顺丰/京东冷链发货，发货地为江西省吉安市遂川县。</p><p><br></p><p>．关于退换货</p><p><br></p><p>依照《消费者权益保护法》第二十五条，《网络购买商品七日无理由退货暂行办法》第六条规定，生鲜产品不适用7天无理由退货。由于生鲜商品的特殊性给您带来不便，敬请谅解。</p><p><br></p><p>因产品保质期较短，收到产品货物请及时检查，如有损坏情况请在快递签收24小时内拍照联系售后客服进行处理。</p><p><br></p><p>．不予赔付情况</p><p><br></p><p>单方面做出拒收行为的，卖家不进行任何理赔。由于生鲜鸡禽、蛋类产品保质期较短，不能进行二次销售，只可接受到货有破损的赔换。其他情况可与客服沟通协商后进行解决。</p><p><br></p><p>擅自拒收和进行退货操作所产生的后果由买家自行承担：因买家原因不能及时签收的不予以理赔。包括但不限于：因电话关机、停机、无人接听、手机故障以及提供号码不正确，或因收货人不在家无人签收等原因导致生鲜鸡禽、蛋品变质等情况。</p><p><br></p><p>良品好物需用心经营，介意者勿拍，敬请谅解。</p><p><br></p><p>．保存小贴士</p><p><br></p><p>收到产品货物后请即时将产品放入冰箱内保鲜,当日烹饪食用。</p><p><br></p><p>&nbsp;</p><p><br></p><p>商品说明</p><p><br></p><p>．划线价格: 是指平台内经营者建议参考价格,是平台内经营者参考线上商城、门市价、吊牌价、专柜价、正品零售价、指导价、曾经展示过的销售价等来源提供的价格，并非《禁止价格欺诈行为的规定》等法律条款中所指的＂原价＂，仅供购买时参考。</p><p><br></p><p>．未划线价格:是指商品的实时价格，不因表述的差异改变性质。具体成交价格会根据商品参加促销活动，优惠券，积分抵扣等情形发生变化，最终以订单结算页面展示的价格为准。</p><p><br></p><p>．商家详情页以图片或文字标注的促销价、优惠价等价格，可能是通过优惠券、积分折扣、满减或特定的促销活动，在特定时间段内形成的价格，具体请以商家促销活动规则、优惠条件和结算页面的标价为准，此说明仅当出现价格比较时有效。若商家对商品的划线价做了特殊说明，则以特殊说明为准。</p><p><br></p><p>此页面下的商品/服务的标题、价格、详情等信息内容系由小象农庄线上商城旗舰店店铺发布，其真实性，准确性和合法性均由小象农庄线上商城旗舰店负责。如消费者对服务的标题、价格、详情等任何信息有疑问，请在购买前与小象农庄线上商城旗舰店店铺客服工作人员进行沟通确认。</p><p><br></p><p>．良品好物用心经营，新鲜美味及时送达。小象农庄线上商城旗舰店祝您购物愉快！</p>', null, null);
